/*

Built by Luminesence starting feb 20th 2024

Tools used: tailwind, javascript, and magic.

The Component class is used to render the html and other styles

The Component class does not actually directly render the html, letting
you run functions and mapping data before its sent to the user, allowing easy inbeds
of vairables and other stuff.

The createRoot is the thing that actually renders the javascript as html.

*/

class Component {
    constructor() {
        this.state = null;
        this.node = null;
        this.ComponentMounted = false;

        // Bind methods to the instance
        for (let key of Object.getOwnPropertyNames(this.constructor.prototype)) {
            const value = this[key];
            if (typeof value === 'function') {
                this[key] = value.bind(this);
            }
        }
    }

    render() {
        this.ComponentMounted = true;

        throw new Error('You must override the render method');
    }

    refresh() {
        // Store a reference to the original render method
        const originalRender = this.render.bind(this);
    
        // Wipe out the render method
        this.render = () => '';
    
        // Call the original render method to get the new HTML content
        const html = originalRender();
    
        // Restore the original render method
        this.render = originalRender;
    
        // Set the new HTML content
        if (!this.node) {
            throw new Error('Component is not yet mounted');
        }
        this.node.innerHTML = html;
    }
    

    static useEffect(callback, dependencies) {
        let previousValue;

        function checkChanges() {
            // Get dependencies
            const currentValue = dependencies();

            if (!isEqual(currentValue, previousValue)) {
                callback();
            }

            previousValue = copyValue(currentValue);
            // This may cause lag, as it updates every screen refresh
            requestAnimationFrame(checkChanges);
        }

        function isEqual(value1, value2) {
            // Special cases
            if (value1 === value2) return true;
            if (typeof value1 !== typeof value2) return false;

            if (Array.isArray(value1) && Array.isArray(value2)) {
                return arraysEqual(value1, value2);
            }

            return false;
        }

        function arraysEqual(arr1, arr2) {
            if (arr1.length !== arr2.length) return false;

            for (let i = 0; i < arr1.length; i++) {
                if (arr1[i] !== arr2[i]) return false;
            }

            return true;
        }

        function copyValue(value) {
            if (Array.isArray(value)) {
                return value.slice();
            }

            return value;
        }

        checkChanges();
    }

    static useState(initialValue) {
        // change value to updated value
        let state = initialValue;
    
        // check if the new value is the correct type
        function setState(newValue) {
            if (typeof initialValue !== typeof newValue && initialValue !== null) {
                throw new Error(`State is not of correct type: <${typeof initialValue}> is not assignable to type <${typeof newValue}>`);
            }
            state = newValue;
        }
    
        function getState() {
            return state;
        }
    
        return [getState, setState];
    }

    toFunction(callback) {
        if (typeof callback !== 'function') throw new Error(`toFunction callback is not of type function. At <${typeof callback}>`);
    
        // Convert function to string
        let callbackString = callback.toString();
    
        // Replace every "" with ``
        callbackString = callbackString.replace(/"/g, '`');
    
        const newCallback = `(${callbackString})(event)`;
    
        return newCallback;
    }    

    createRoot(node) {
        this.node = node;
        const html = this.render();
        const tempElement = document.createElement('div');
        tempElement.innerHTML = html.trim();

        // Append each child element to the root node
        tempElement.childNodes.forEach(child => {
            node.appendChild(child);
        });

        this.refresh();
        this.ComponentMounted = true;

        // Attach event listeners using event delegation
        node.addEventListener('click', event => {
            if (event.target.tagName.toLowerCase() === 'button' && event.target.dataset.clickHandler) {
                const handlerName = event.target.dataset.clickHandler;
                this[handlerName](); // Call the method dynamically based on the data-click-handler attribute
                this.refresh(); // Refresh the component after handling the event
            }
        });
    }
}

