function lightenColor(color, percent) {
    // Helper function to convert hex to RGB
    function hexToRgb(hex) {
      const num = parseInt(hex.slice(1), 16);
      return {
        r: (num >> 16) & 0xFF,
        g: (num >> 8) & 0xFF,
        b: num & 0xFF
      };
    }
  
    // Helper function to convert RGB to hex
    function rgbToHex(r, g, b) {
      return `#${(r << 16 | g << 8 | b).toString(16).padStart(6, '0')}`;
    }
  
    // Remove any leading or trailing spaces
    color = color.trim();
  
    // Check if the input is a color name
    if (/^[a-zA-Z]+$/.test(color)) {
      const span = document.createElement('span');
      span.style.color = color;
      document.body.appendChild(span);
      const rgbColor = getComputedStyle(span).color;
      document.body.removeChild(span);
      const { r, g, b } = hexToRgb(rgbColor);
      color = { r, g, b };
    }
  
    // Check if the input is a hex value
    if (color.startsWith('#')) {
      let { r, g, b } = hexToRgb(color);
  
      // Calculate luminance
      const luminance = 0.2126 * r + 0.7152 * g + 0.0722 * b;
  
      // Adjust lightening based on luminance
      const delta = luminance < 128 ? percent : -percent;
      r = Math.max(0, Math.min(255, r + Math.round((255 - r) * (delta / 100))));
      g = Math.max(0, Math.min(255, g + Math.round((255 - g) * (delta / 100))));
      b = Math.max(0, Math.min(255, b + Math.round((255 - b) * (delta / 100))));
  
      // Convert back to hex
      const newColor = rgbToHex(r, g, b);
      return newColor;
    }
  
    // If the color format is not recognized
    throw new Error('Invalid color format. Please provide a valid hex value or color name.');
  }
