let triggerBrowser = 0;
const updateTabUrl = (event, tabID) => {
    event.preventDefault();

    const newUrl = event.target.value;

    Browser.tabs.forEach(tab => {
        if (tab.id === tabID) {
            tab.url = newUrl;
        }
    });
    const newTitle = event.target.value.replace("https://", "");

    Browser.tabs.forEach(tab => {
        if (tab.id === tabID) {
            tab.title = newTitle;
        }
    });
    triggerBrowser++;

    // Update iframe src when the URL changes
    const frame = document.getElementById("browserFrame");
    frame.src = newUrl;
}

