// Class Promt will provide a popup for the user
class Popup extends Component {

    constructor(component) {
        super();

        if (typeof component !== "string") throw new Error(`Component is not of type <stringNode>. At new Popup. At typeof <${typeof component}>.`);
        this.component = component;
    }

    render() {
        
        return `
        <div style="top: 0px; left: 0px; position: absolute; width: 100vw; height: 100vh; display: flex; justify-content: center; align-items: center; background: transparent; z-index: 100; backdrop-filter: blur(20px);">
            <div style="width: 50%; height: 50%; background-color:rgba(0, 0, 0, 0.5); backdrop-filter: brightness(.2);" class="rounded p-2 shadow text-white">
                ${this.component}
            </div>
        </div> 
        `
    }

    getAsNode() {
        // Don't mess with this please it returns html.body.actual-stuff
        return new DOMParser().parseFromString(this.render(), "text/html").childNodes[0].childNodes[1].childNodes[0];
    }
}

// Draggable for apps and stuffs
// Stores the current id for it to drag
class Draggable {
    constructor() {
        this.width = 400;
        this.height = 300;
        this.top = 0;
        this.left = 0;

        this.zAxis = 20;
    }

    dragElement(elmnt, name) {
        const thisApp = apps.find(app => app.name === name);
        var pos1 = thisApp.position.y, pos2 = thisApp.position.x, pos3 = 0, pos4 = 0;
        let appX = thisApp.position.x;
        let appY = thisApp.position.y;

        // useEffect for keeping the position tracked and updated
        Component.useEffect(() => {
            thisApp.position.x = appX;
            thisApp.position.y = appY;
            apps = apps.map(app => (app.name === name ? thisApp : app));
        }, () => [appX, appY]);

        elmnt.onmousedown = dragMouseDown;

        function dragMouseDown(e) {
            e = e || window.event;
            e.preventDefault(); // Prevent default action
            pos3 = e.clientX;
            pos4 = e.clientY;
            document.onmouseup = closeDragElement;
            document.onmousemove = elementDrag;
        }

        function elementDrag(e) {
            e = e || window.event;
            e.preventDefault(); // Prevent default action
            // calculate the new cursor position:
            pos1 = pos3 - e.clientX;
            pos2 = pos4 - e.clientY;
            pos3 = e.clientX;
            pos4 = e.clientY;
            // set the element's new position:
            elmnt.style.top = (elmnt.offsetTop - pos2) + "px";
            elmnt.style.left = (elmnt.offsetLeft - pos1) + "px";
            pos1 = elmnt.offsetLeft - pos1;
            pos2 = elmnt.offsetTop - pos2;
            appX = elmnt.style.left;
            appY = elmnt.style.top;
        }

        function closeDragElement() {
            document.onmouseup = null;
            document.onmousemove = null;
        }
    }

    static fullScreenElement(element) {
        if (element.nodeType !== 1) throw new Error(`Element is not of type <node>. At fullScreenElement; At Draggable.fullScreenElement(${element})`);

        if (element.style.width === "100%") {
            element.style.height = "300px";
            element.style.width = "400px";
        } else {
            element.style.top = 0;
            element.style.left = 0;
            element.style.height = "100%";
            element.style.width = "100%";
        }
    }

    static hideElement(element) {
        if (element.nodeType !== 1) throw new Error(`Element is not of type <node>. At hideElement; At Draggable.hideElement(${element})`);
    
        if (element.style.opacity === 1) {
            element.style.opacity = 0;
        } else {
            element.style.opacity = 1;
        }
    }

    static currentIdNum = 0;

    render(component, name, toolbar = '') {
        Draggable.currentIdNum++;
        var elementId = `draggableElement${Draggable.currentIdNum}`;
        var wrapper = document.createElement('div');
        wrapper.id = elementId;

        const changeZ = (ele) => {
            const element = ele;
            document.addEventListener('click', (e) => {
                if (!element.contains(e.target)) {
                    element.style.zIndex = 20
                } else {
                    element.style.zIndex = 50
                }
            });
        }

        // Add custom toolbar on top
        wrapper.innerHTML = `
        <div onclick="(${changeZ})(this)" class="absolute w-full h-full flex flex-col rounded-t flex flex-row justify-end items-center resize shadow-md" style="resize: both; z-index: ${this.zAxis};">
            <div class="w-full flex flex-row justify-end items-center bg-transparent backdrop-blur-lg backdrop-brightness-75 p-2 cursor-move resize">
                <h1 class="flex-grow font-bold">${name}</h1>
                <button class="w-5 h-5 transition-transform hover:scale-105 active:scale-96 duration-200 invert" onclick="Draggable.fullScreenElement(document.getElementById('draggableElement${Draggable.currentIdNum}'))"><svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 512 512"><!--!Font Awesome Free 6.5.1 by @fontawesome - https://fontawesome.com License - https://fontawesome.com/license/free Copyright 2024 Fonticons, Inc.--><path d="M64 32C28.7 32 0 60.7 0 96V416c0 35.3 28.7 64 64 64H448c35.3 0 64-28.7 64-64V96c0-35.3-28.7-64-64-64H64zM96 96H416c17.7 0 32 14.3 32 32s-14.3 32-32 32H96c-17.7 0-32-14.3-32-32s14.3-32 32-32z"/></svg></button>
                <button class="w-6 h-6 transition-transform hover:scale-105 active:scale-96 duration-200 pl-2 invert" onclick="setComponent('${name}')"><svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 448 512"><!--!Font Awesome Free 6.5.1 by @fontawesome - https://fontawesome.com License - https://fontawesome.com/license/free Copyright 2024 Fonticons, Inc.--><path d="M64 32C28.7 32 0 60.7 0 96V416c0 35.3 28.7 64 64 64H384c35.3 0 64-28.7 64-64V96c0-35.3-28.7-64-64-64H64zm79 143c9.4-9.4 24.6-9.4 33.9 0l47 47 47-47c9.4-9.4 24.6-9.4 33.9 0s9.4 24.6 0 33.9l-47 47 47 47c9.4 9.4 9.4 24.6 0 33.9s-24.6 9.4-33.9 0l-47-47-47 47c-9.4 9.4-24.6 9.4-33.9 0s-9.4-24.6 0-33.9l47-47-47-47c-9.4-9.4-9.4-24.6 0-33.9z"/></svg></button>
            </div>
            <div id='component${elementId}' class="w-full h-full bg-white resize" style="resize: both; overflow: auto;">
                ${component}
            </div>
        </div>
        `;
    
        // Add position: relative; to the parent div's style
        const appPos = apps.find(app => app.name === name);
        wrapper.style.position = 'absolute';
        wrapper.style.width = '400px';
        wrapper.style.height = '300px';
        wrapper.style.resize = 'both';
        wrapper.style.top = appPos.position.y;
        wrapper.style.left = appPos.position.x;
    
        // Delay adding drag functionality until the element is in the DOM
        setTimeout(() => {
            var draggableElement = document.getElementById(elementId);
            if (draggableElement) {
                this.dragElement(draggableElement, name);
            }

            var componentElement = document.getElementById("component" + elementId);
            if (componentElement) {
                document.addEventListener("click", (e) => {
                    if (componentElement.contains(e.target)) {
                        draggableElement.onmousedown = null;
                        draggableElement.onmousemove = null;
                    } else {
                        this.dragElement(draggableElement, name);
                    }
                })
            }
        }, 0);
    
        return wrapper.outerHTML;
    }   
}

async function frameScript(name, path) {
    const grab = (url, type, success, fail) => {
        var req = new XMLHttpRequest();
        req.open("GET", url, true);
        req.overrideMimeType("text/plain; charset=x-user-defined");
        req.responseType = type;
        req.onload = function() {
          if (req.status >= "400") {
            fail(req.status);
          } else {
            success(this.response);
          }
        }
        req.send();
    }
    
    const startPlayer = (data) => {
          if (data) {
                // Check if it double rendered
                if (document.getElementById(`player${path}`)) {
                    return;
                }
                console.log("Initializing with " + data.byteLength + " bytes of data");
                
                // This is the actual flash game
                var flashObject = document.createElement("object");
                flashObject.classList.add("gembed");
                flashObject.type = "application/x-shockwave-flash";
                flashObject.data = URL.createObjectURL(new Blob([data]));

                // This is the mode for the flash object
                var flashObjectWmode = document.createElement("param");
                flashObjectWmode.name = "wmode";
                flashObjectWmode.value = "direct";
                flashObject.appendChild(flashObjectWmode);
                flashObject.id = `player${path}`;
                document.getElementById(name).append(flashObject);
                flashObject.style.width = "100%";
                flashObject.style.height = "100%";
        }
    }
    
    const readyForLoad = () => {        
        console.log("Fetching SWF from " + path + "...");
        grab(path, "arraybuffer", function(data) {
            // start
            console.log("Successfully fetched SWF from " + path);
            startPlayer(data);
        }, (error) => {
            // xhr error
            error("Recieved the following error: " + errorMessage + ". Error code: " + errorCode)
        });
    }
    
    const response = await fetch(path);
    const content = await response.text();

    setTimeout(() => {
        const frame = document.getElementById(`${name}`);
        const app = apps.find(app => app.name === name);

        if (app.type === "swf") {
            readyForLoad();
        } else {
            frame.srcdoc = content;
        }
        
    }, 0)
}

class UserComponent extends Component {
    constructor(name) {
        super();
        this.app = apps.find(app => app.name === name);
    }

    render() {
        if (!this.app.path) throw new Error(`Link is undefined. Please provide a <string>, not <${typeof this.app.path}>`);

        this.node = document.getElementById(`${this.app.name}`);

        frameScript(`${this.app.name}`, `${this.app.path}`);
        if (this.app.type === "swf") {
            return `<div class="w-full h-full overflow-hidden" id="${this.app.name}"></div>`;
        }
        // Using a global function I can easily run scripts
        return `<iframe class="w-full h-full" id="${this.app.name}">Iframe failed to load.</iframe>`
    }
}

class App extends Component {
    constructor() {
        super();
        
        Component.useEffect(() => {
            if (this.ComponentMounted) {
                this.refresh();
            }
        }, () => [currentComponent, loggedIn]);

    }

    render() {
        const getComponent = (name) => {
            const ComponentClass = ComponentClasses[name];

            if (!ComponentClass) {
                return new Draggable().render(new UserComponent(name).render(), name);
            }
            
            return new Draggable().render(new ComponentClass().render(), name);
        }

        this.ComponentMounted = true;
        
        return `
            <div class="w-full h-screen" style="background-image: url(${theme.backgroundImage}); background-repeat: no-repeat; background-size: cover; color: ${theme.text}!important" id='window'>
                ${!loginScreen || loggedIn ? `
                    <div class="h-full">
                        ${apps.filter(app => app.open == true).map(app => getComponent(app.name)).join("")}
                        ${new Home().render()}
                        ${new Taskbar().render()}
                    </div>
                    ` : `
                    ${new Login().render()}  
                `}
            </div>
        `;
    }
}

